Prepends an element to the deque, returning a reference to it.

# Examples

```
#![feature(push_mut)]
use std::collections::VecDeque;

let mut d = VecDeque::from([1, 2, 3]);
let x = d.push_front_mut(8);
*x -= 1;
assert_eq!(d.front(), Some(&7));
```

